package net.certiv.test;

import java.awt.BorderLayout;
import javax.swing.JPanel;
import java.awt.GraphicsConfiguration;
import java.awt.HeadlessException;

import javax.swing.JFrame;

public class JTestPanel2Frame extends JFrame {

	private JPanel jContentPane = null;
	private JTestPanel2 testPanel = null;

	public JTestPanel2Frame() throws HeadlessException {
		super();
		initialize();
	}

	public JTestPanel2Frame(GraphicsConfiguration gc) {
		super(gc);
		initialize();
	}

	public JTestPanel2Frame(String title) throws HeadlessException {
		super(title);
		initialize();
	}

	public JTestPanel2Frame(String title, GraphicsConfiguration gc) {
		super(title, gc);
		initialize();
	}

	/**
	 * This method initializes testPanel	
	 * 	
	 * @return net.certiv.test.JTestPanel2	
	 */    
	private JTestPanel2 getTestPanel() {
		if (testPanel == null) {
			testPanel = new JTestPanel2();
			testPanel.setStringValueProperty("Order reversed.");
			testPanel.setToolTipText("test");
		}
		return testPanel;
	}

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		JTestPanel2Frame appl = new JTestPanel2Frame();
		appl.setVisible(true);
	}

	/**
	 * This method initializes this
	 * 
	 * @return void
	 */
	private void initialize() {
		this.setSize(300, 200);
		this.setContentPane(getJContentPane());
		this.setTitle("JFrame");
	}

	/**
	 * This method initializes jContentPane
	 * 
	 * @return javax.swing.JPanel
	 */
	private JPanel getJContentPane() {
		if (jContentPane == null) {
			jContentPane = new JPanel();
			jContentPane.setLayout(new BorderLayout());
			jContentPane.add(getTestPanel(), java.awt.BorderLayout.CENTER);
		}
		return jContentPane;
	}

}
